import React from 'react'

function Header(props) {
    return (
        <div>
            <h1>Lutrivia</h1>
            <button type='submit' onSubmit={(e) => props.handleNewGameButton(e)} >
                New Game
            </button>
            <h4>Score: {props.score}</h4>
        </div>
    )
}

export default Header
